import { Navbar } from "./pages/navbar/Navbar";
import { Hero } from "./pages/hero/Hero";
import { Howto } from "./pages/howto/Howto";
import { Intro } from "./pages/intro/Intro";
import { Tokenomic } from "./pages/tokenomic/Tokenomic";
import { Roadmap } from "./pages/roadmap/Roadmap";
import { Partner } from "./pages/partner/Partner";
import { Footer } from "./pages/footer/Footer";

function App() {  

  return (
    <main className="relative bg-heroBg bg-no-repeat w-full h-[8192px] overflow-hidden text-left text-111xl text-black font-inter">
      {/* className="bg-heroBg bg-no-repeat bg-cover w-full" */}
      <img
        className="absolute top-[0px] left-[0px] w-[2502.56px] h-[9674px] object-cover"
        alt=""
        src="/group-14@2x.png"
      />
      <Navbar/>
      <Hero />
      <Intro />
      <Tokenomic />
      <Howto/>
      <Roadmap/>
      <Partner />
      <Footer/>
    </main>
    // <Routes>
    //   <Route path="/" element={<Slide1691 />} />
    // </Routes>
  );
}
export default App;
